import React from 'react';
import UserList from './ejercicio-4/UserList.js';

class Ejercicio4 extends React.Component {
    removeComponent() {
        this.showList = false;
    }

    render() {
        return (
            <div>
                <h1 className="ejercicio">4. Ciclos de vida</h1>
                <UserList show={this.showList} />
                <button onClick={this.removeComponent}>Eliminar</button>
            </div>
        )
    }
}

export default Ejercicio4;
